import { Link } from 'react-router-dom';

function NewsNav () {
    return (
        <div className='socialNavigation'>
            <Link to="home/instagram" className="sidebar-link">Instagram</Link>
            <Link to="home/infatuation" className="sidebar-link">Infatuation</Link>
            <Link to="home/timeout" className="sidebar-link">Timeout</Link>
            <Link to="home/eater" className="sidebar-link">Eater</Link>
        </div>
    )


}

export default NewsNav
